BITS 64
CPU X64

%define SYSCALL_EXIT 60
%define SYSCALL_WRITE 1

section .data


prefix: db 1
input: db ""
;input: db "dabAcCaCBAcCcaDA"
static input:data

%define input_len 50000
;%define input_len 16

section .text

exit:
static exit:function
  mov rax, SYSCALL_EXIT
  mov rdi, 0
  syscall

write_int_to_stdout:
static write_int:function
	push rbp
	mov rbp, rsp

	sub rsp, 20

	%define ARG0 rdi
	%define N rax
	%define BUF rsi
	%define BUF_LEN r10
	%define BUF_END r9

	lea BUF, [rsp+20]
	mov BUF_LEN, 0
	lea BUF_END, [rsp]
	mov N, ARG0

	.loop:
		mov rcx, 10 ; Divisor.
		mov rdx, 0 ; Reset rem.
		div rcx ; rax /= rcx

		add rdx, '0' ; Convert to ascii.

		; *(end--) = rem
		dec BUF_END
		mov [BUF_END], dl
		
		inc BUF_LEN

		cmp N, 0
		jnz .loop

	mov rax, SYSCALL_WRITE
	mov rdi, 1
	mov rsi, BUF_END
	mov rdx, BUF_LEN
	syscall


	%undef ARG0
	%undef N
	%undef BUF
	%undef BUF_LEN
	%undef BUF_END

	add rsp, 20
	pop rbp
	ret

