solve:
static solve:function
  push rbp
  mov rbp, rsp

  %define INPUT_LEN r10
  %define CURRENT r9
  %define NEXT r11
  %define REMAINING_COUNT rax
  %define END r8

  lea CURRENT, [input] 
  lea NEXT, [input + 1] 
  mov INPUT_LEN, input_len
  mov REMAINING_COUNT, INPUT_LEN
  lea END, [input]
  add END, INPUT_LEN
  

.loop:
  movzx dx, BYTE [CURRENT]
  movzx cx, BYTE [NEXT]
  sub dx, cx
  imul dx, dx

  mov rcx, 32*32

  cmp rdx, rcx
  jnz .else
  .then:
    mov BYTE [CURRENT], 0
    mov BYTE [NEXT], 0

    sub REMAINING_COUNT, 2

		.reverse_search:
		dec CURRENT
		mov dl, [CURRENT]
		cmp dl, 0
		jz .reverse_search


    jmp .endif
  .else:
    mov CURRENT, NEXT
  .endif:

  inc NEXT
  cmp NEXT, END
  jl .loop

	%undef INPUT_LEN
	%undef CURRENT
	%undef NEXT
	%undef REMAINING_COUNT
	%undef END


  pop rbp
  ret

global _start
_start:
  call solve

	mov rdi, rax
  call write_int_to_stdout

  call exit

